import React, { useState } from 'react';
import './App.css';

function App() {
  const [darkMode, setDarkMode] = useState(false);
  const [currentSection, setCurrentSection] = useState('overview');

  const handleNavClick = (section) => {
    setCurrentSection(section);
  };

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  return (
    <div className={`App ${darkMode ? 'dark-mode' : ''}`}>
      <Navbar handleNavClick={handleNavClick} />
      <div className="content">
        {currentSection === 'overview' && <Overview />}
        {currentSection === 'projects' && <Projects />}
        {currentSection === 'about' && <About />}
        {currentSection === 'contact' && <Contact />}
      </div>
      <button onClick={toggleDarkMode} className="mode-toggle">
        {darkMode ? 'Light Mode' : 'Dark Mode'}
      </button>
    </div>
  );
}

function Navbar({ handleNavClick }) {
  return (
    <nav className="navbar">
      <ul>
        <li><button onClick={() => handleNavClick('overview')}>Overview</button></li>
        <li><button onClick={() => handleNavClick('projects')}>Projects</button></li>
        <li><button onClick={() => handleNavClick('about')}>About</button></li>
        <li><button onClick={() => handleNavClick('contact')}>Contact Info</button></li>
      </ul>
    </nav>
  );
}

function Overview() {
  return (
    <section id="overview" className="section">
      <h2>Overview</h2>
      <p>This is the overview section of your portfolio.</p>
    </section>
  );
}

function Projects() {
  return (
    <section id="projects" className="section">
      <h2>Projects</h2>
      <p>This is the projects section of your portfolio.</p>
    </section>
  );
}

function About() {
  return (
    <section id="about" className="section">
      <h2>About</h2>
      <p>This is the about section of your portfolio.</p>
    </section>
  );
}

function Contact() {
  return (
    <section id="contact" className="section">
      <h2>Contact Info</h2>
      <p>This is the contact info section of your portfolio.</p>
    </section>
  );
}

export default App;
